import React from 'react'
import data from './users.json'
import UserItem from './UserItem.js';
import AverageAge from './AverageAge.js';

const UserList = () => {
   // console.log(result)
   const myFunc = (total, current) => {
      return total += current
   }
   const test = () => {
      let ageArray = []
      data.map((item) => {
         return (
            ageArray.push(item.age)
         )
      })
      ageArray.reduce(myFunc);
   }
   const average = () => {
      let age = 0;
      var count = 0;
      // let result = ''

      const result = data.filter(item => item.role === 'admin')
      const countAdmin = result.length;
      data.map((item) => {

         if (item.role === 'admin') {
            age += item.age / countAdmin
         }

      })
      return age
   }
   return (
      <div >
         {data.map((users) => {
            return (
               (users.role === 'user' ?
                  <UserItem name={users.name} />
                  : ''
               )
            )
         })}
         <AverageAge average={average()} />
         <button onClick={test}>test</button>
      </div>)
}

export default UserList
